                                        QUANTITY=COALESCE(${aidPackageItem.quantity}, QUANTITY);`;
        sql:ExecutionResult result = check dbClient->execute(query);
        if result.lastInsertId is int {
            aidPackageItem.packageItemID = <int> result.lastInsertId;
